        private void OltInfoChanged_TextChanged(object sender, TextChangedEventArgs e)
        {
            workViewModel.ShowProgress = Visibility.Visible;
            workViewModel.IsEnabledView = false;

            if (string.IsNullOrEmpty(workViewModel.SearchOltInfo))
            {
                workViewModel.OltName = "";

            }
            else
            {
                //使用正则式提取OLT
                //var pattern = @"[A-Z][A-Z]{1,2}-(([^\u0020])*)";

                var pattern = @"[\u4e00-\u9fa5a-zA-Z]{2}([\u4e00-\u9fa5a-zA-Z])*-(([^\u0020])*)";

                Match match = Regex.Match(workViewModel.SearchOltInfo, pattern);
                if (match.Success)
                {
                    workViewModel.OltName = match.Value;
                    WriteOperateInfo("搜索OLT", "发现OLT:" + workViewModel.OltName);
                }
                else
                {
                    workViewModel.OltName = "";
                    WriteOperateInfo("搜索OLT", "给定内容中未发现OLT");
                }

            }

            workViewModel.ShowProgress = Visibility.Collapsed;
            workViewModel.IsEnabledView = true;
        }

        private void TextBox_PreviewMouseDown(object sender, MouseButtonEventArgs e)
        {
            workViewModel.SearchOltInfo = "";
            workViewModel.OltName = "";
        }


