        private void DataGrid_LoadingRow(object sender, DataGridRowEventArgs e)
        {
            e.Row.MouseRightButtonDown += (s, a) =>
            {
                a.Handled = true;
                (sender as DataGrid).SelectedIndex = (s as DataGridRow).GetIndex();
                (s as DataGridRow).Focus();

            };
        }

        /// <summary>
        /// 写入操作信息
        /// </summary>
        /// <param name="operate"></param>
        /// <param name="operateData"></param>
        private void WriteOperateInfo(string operate, string operateData)
        {
            var opreateDate = DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss");
            string operateInfo = opreateDate + " " + operate + ":" + operateData;
            Application.Current.Dispatcher.Invoke(new Action(() =>
            {
                workViewModel.OperateInfo.Add(operateInfo);
            }));
        }



        private void DataGrid_Pon_SelectionChanged(object sender, SelectionChangedEventArgs e)
        {
            PonData.RowsItem rowsItem = new PonData.RowsItem();
            if ((sender as DataGrid).SelectedItem == null) { return; }
            rowsItem = (PonData.RowsItem)(sender as DataGrid).SelectedItem;
            workViewModel.GuangjiaoPosName = rowsItem.EQP_NAME;
            WriteOperateInfo("选取PON信息", rowsItem.NO + ":" + rowsItem.EQP_NAME);
            try
            {
                //Clipboard.SetText(b.name.ToString());
                Clipboard.SetDataObject(rowsItem.EQP_NAME.ToString());
            }
            catch { }

        }

