        /// <summary>
        /// 修复端口
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void MarkPortFree_PreviewMouseLeftButtonDown(object sender, MouseButtonEventArgs e)
        {
            if (workViewModel.SelectedPosPortData == null) { return; }

            //测试修改端口
            if (workViewModel.SelectedPosPortData.OPR_STATE == "占用" || workViewModel.SelectedPosPortData.OPR_STATE == "预占" || workViewModel.SelectedPosPortData.OPR_STATE == "空闲") { return; }
            var modifyStatusCode = "170001";
            var modifyStatus = "%E7%A9%BA%E9%97%B2"; //空闲

            Task.Run(new Action(() =>
            {
                Application.Current.Dispatcher.Invoke(new Action(() =>
                {
                    workViewModel.ShowProgress = Visibility.Visible;
                    workViewModel.IsEnabledView = false;
                }));

                ModifyGFPosPortStatus(workViewModel.SelectedPosPortData.ID, workViewModel.SelectedPosPortData.NO, modifyStatus, modifyStatusCode);

                Application.Current.Dispatcher.Invoke(new Action(() =>
                {
                    workViewModel.ShowProgress = Visibility.Collapsed;
                    workViewModel.IsEnabledView = true;
                }));
            }));

        }
        /// <summary>
        /// 标记故障端口
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void MarkPortBad_PreviewMouseLeftButtonDown(object sender, MouseButtonEventArgs e)
        {
            if (workViewModel.SelectedPosPortData == null) { return; }

            if (workViewModel.SelectedPosPortData.OPR_STATE != "空闲") { return; }
            var modifyStatusCode = "17001993";
            var modifyStatus = "%E6%A0%87%E8%AE%B0%E4%B8%BA%E6%95%85%E9%9A%9C"; //标记为故障

            Task.Run(new Action(() =>
            {
                Application.Current.Dispatcher.Invoke(new Action(() =>
                {
                    workViewModel.ShowProgress = Visibility.Visible;
                    workViewModel.IsEnabledView = false;
                }));
                ModifyGFPosPortStatus(workViewModel.SelectedPosPortData.ID, workViewModel.SelectedPosPortData.NO, modifyStatus, modifyStatusCode);

                Application.Current.Dispatcher.Invoke(new Action(() =>
                {
                    workViewModel.ShowProgress = Visibility.Collapsed;
                    workViewModel.IsEnabledView = true;
                }));
            }));
        }

